        protected override void NewSearch()
        {
            base.NewSearch();

            this.edtSucheSozialzentrum.EditValue = qryDat["SozialzentrumCode"];
            this.edtSucheOrgUnit.EditValue = qryDat["OrgUnitID"];
        }

        #endregion

        #region Private Methods

        private void CtlQueryFaVoranmeldung_Load(object sender, System.EventArgs e)
        {
            this.edtSucheSozialzentrum.EditValue = qryDat["SozialzentrumCode"];
            this.edtSucheOrgUnit.EditValue = qryDat["OrgUnitID"];

            if (DBUtil.UserHasRight("CtlQueryFaVoranmeldung_AbfrageAlleSozialDienste"))
            {
                this.edtSucheSozialzentrum.EditMode = EditModeType.Normal;
            }
            else if (DBUtil.IsEmpty(edtSucheSozialzentrum.EditValue))
            {
                this.edtSucheSozialzentrum.EditValue = -1;
                KissMsg.ShowInfo("Sie sind keinem Sozialzentrum zugeordnet");
            }
        }

        private void btnJumpTo_Click(object sender, System.EventArgs e)
        {
            // Voranmeldung öffnen
            FormController.OpenForm("FrmFall", "Action", "JumpToNodeByFieldValue",
                "BaPersonID", qryQuery["BaPersonID"],
                "ModulID", 2,
                "FieldValue", string.Format(@"CtlFaVoranmeldung{0}", qryQuery["FaLeistungID"]));
        }

        private void edtSucheSozialzentrum_EditValueChanged(object sender, System.EventArgs e)
        {
            if (DBUtil.IsEmpty(edtSucheSozialzentrum.EditValue))
                edtSucheOrgUnit.EditValue = null;

            edtSucheOrgUnit.LoadQuery(DBUtil.OpenSQL(@"
                SELECT Code = ORG.OrgUnitID, Text = ORG.ItemName
                    FROM XLOVCode         LOV
                     INNER JOIN XOrgUnit  ORG ON ORG.parentid = convert(int, LOV.Value1)
                    WHERE
                 LOV.Code = {0} and LOVName like 'FaSozialzentrum'
                union all
                 select null,null
                order by Text", edtSucheSozialzentrum.EditValue));
        }

        #endregion
